const Post = ({props}) => {
    const { articleID, articleTitle, articleSummary, datePublished, sitePublishedOn } = props.post
    return(
        <div className='postContainer' key={articleID}>
            <div className='postTextContainer'>
                <h1 className='articleTitle'>{articleTitle}</h1>
                <p className='newsArticle'>{articleSummary}</p>
                <span className='publishDate'>{datePublished}</span>
                <span className='postSite'>{sitePublishedOn}</span>
            </div>
        </div>
    )
}

export default Post;
